import React from 'react';
import '../../../../App.css';

const city = (props) => {
    let imgSrc = props.setImg(props.currentWeather);
        return (
            <div className="card cityCard"
                 onClick={props.click}>
                <h2>{props.city}</h2>
                <div className="displayFlex displayRow contentCenter">
                <img src={imgSrc} alt={props.currentWeather} className="cityImg"/>
                <p className="temperature">{props.currentTemp} <sup>C</sup></p>
                </div>
            </div>

        );
}

export default city;
